import React from 'react'
import useHome from '../data/useHome'
import parse from 'html-react-parser'

const Home = () => {
    const home = useHome();
    console.log(home);
    if ( home !== null ) {
    return (
        home.map(item => (
            <div key={item}>
                <h1>{item.title}</h1>
                {parse(item.content)}
            </div>
        ))
    )}
}

export default Home
